pragma solidity ^0.8.0;

contract CompoundNFT is ERC721("CompoundNFT", "NFT"), Ownable {
    using SafeMath for uint256; //using safe math lib for math.
    using Counters for Counters.Counter; // using counter lib for nft tokens.
    Counters.Counter public _tokenIdCounter;

    // ERC20 Token Interfaces
    IERC20 public daiToken; // Interface for DAI Token
    CErc20Interface public cDaiToken; // Interface for Compound DAI Token
    CTokenInterface public cT; // Interface for CToken

    // Addresses
    address public cDaiTokenAddress; // Address for Compound DAI Token
    ComptrollerInterface public comptroller; // Interface for Compound Comptroller

    // Minting parameters and accounting variables
    uint256 public mintingPrice = 1 * 10 ** 18; // Minting price set to 1 DAI (in wei)
    uint256 public interestAccrued; // Accumulated interest

    // Struct to hold user-specific data
    struct userData {
        uint256 investmentTime;
        uint256 DepositDaiToken;
        uint256 recivedCToken;
        address user;
    }
    event NFTMinted(uint256 tokenId, address owner); // event for NFTMint function
    event NFTBurned(uint256 tokenId, address owner); // event for NFTBurn function
    // Mapping from NFT ID to user data
    mapping(uint256 => userData) public userDetails;

    // Constructor to initialize the contract with DAI and cDAI addresses
    constructor(
        address _daiTokenAddress, //0x2899a03ffDab5C90BADc5920b4f53B0884EB13cC dai address for goreli testnet
        address _cDaiTokenAddress //0x0545a8eaF7ff6bB6F708CbB544EA55DBc2ad7b2a cDai address for goreli testnet
    ) {
        daiToken = IERC20(_daiTokenAddress);
        cDaiToken = CErc20Interface(_cDaiTokenAddress);
        cT = CTokenInterface(_cDaiTokenAddress);
        cDaiTokenAddress = _cDaiTokenAddress;
    }

    // Function to mint NFT by depositing 100 DAI tokens  and depositing to Compound
    function mintNFT() external {
        // Transfer 100 DAI from user to contract
        daiToken.transferFrom(msg.sender, address(this), mintingPrice);
        uint256 tokenId = _tokenIdCounter.current();
        // Mint new NFT and assign to the user
        _mint(msg.sender, tokenId);

        // Approve Compound contract to spend DAI
        daiToken.approve(cDaiTokenAddress, mintingPrice);

        // Deposit 100 DAI to Compound Finance
        uint256 beforeMint = cT.balanceOf(address(this));
        uint256 mintResult = cDaiToken.mint(mintingPrice);
        // check deposit success
        require(mintResult == 0, "Compound deposit failed");
        uint256 afterMint = cT.balanceOf(address(this));

        // Update user data
        userDetails[tokenId] = userData(
            block.timestamp,
            mintingPrice,
            afterMint.sub(beforeMint),
            msg.sender
        );
        // Emit NFTMinted event
        emit NFTMinted(tokenId, msg.sender);
        // Increment total NFT count
        _tokenIdCounter.increment();
    }

    // Function to burn NFT, withdraw from Compound, and return 100 DAI tokens to user
    function burnNFT(uint256 tokenId) external {
        // Check if sender owns the NFT and it's approved
        require(ownerOf(tokenId) == msg.sender, "Not the owner");
        require(_isApprovedOrOwner(msg.sender, tokenId), "Not approved");

        // Withdraw 100 DAI from Compound Finance
        uint256 beforeMint = cT.balanceOf(address(this));
        uint256 redeemResult = cDaiToken.redeemUnderlying(mintingPrice);
        // Check withdrawal success
        require(redeemResult == 0, "Compound withdrawal failed");
        uint256 afterMint = cT.balanceOf(address(this));
        uint256 final_ = beforeMint.sub(afterMint);

        // Update user data
        userDetails[tokenId].DepositDaiToken = userDetails[tokenId]
            .DepositDaiToken
            .sub(mintingPrice);
        userDetails[tokenId].recivedCToken = userDetails[tokenId]
            .recivedCToken
            .sub(final_);
        interestAccrued = interestAccrued.add(
            userDetails[tokenId].recivedCToken
        );

        // Transfer 100 DAI tokens back to the user
        daiToken.transfer(msg.sender, mintingPrice);

        // Burn the NFT
        _burn(tokenId);
        // Emit NFTBurned event
        emit NFTBurned(tokenId, msg.sender);
    }

    // Function for admin to withdraw accrued interest in cTokens
    function withdrawInterestIncTOKEN() external onlyOwner {
        require(interestAccrued > 0, "insufficient interest accrued balance");
        cT.transfer(owner(), interestAccrued);
        interestAccrued = 0;
    }

    // Function for admin to withdraw accrued interest in DAI
    function withdrawInterestInDai() external onlyOwner {
        require(interestAccrued > 0, "insufficient interest accrued balance");
        uint256 beforeDaiBal = daiToken.balanceOf(address(this));
        cDaiToken.redeem(interestAccrued);
        uint256 afterDaiBal = daiToken.balanceOf(address(this));
        daiToken.transfer(owner(), afterDaiBal.sub(beforeDaiBal));
        interestAccrued = 0;
    }

    // Function to read current NFT TokenId
    function getCurrentTokenId() public view returns (uint256) {
        return _tokenIdCounter.current();
    }
}

